import styled from "styled-components";

export const Wrapper = styled.div `
	{
		margin: 20px auto;
		font-size: 16px;
		width: 100%;
		height: 10%;
		position: absolute;
        top: 0;
        left: 0;
        text-align: center;
	}
`;

export const Logga = styled.div `
	{
		padding-left: 20px;
		font-size: 1.3em;
		width: 50%;
		height: 10%;
		position: relative;
        text-align: left;

		@media screen and (max-width: 620px) {
			{
			  display: none;
			}
		  }
	}
`;
